import React from 'react';
import CoursesList from './CoursesList';
import { Link } from 'react-router-dom';

const Courses = () => {
    return (
        <>
            <div className='jumbotron'>
                <h1>Courses</h1>
                <Link to='/course' className='btn btn-primary mt-3'>
                    Add Course
                </Link>
            </div>
            <CoursesList />
        </>
    );
};

export default Courses;
